import { createRouter, createWebHistory } from 'vue-router';
import HomePage from './components/HomePage.vue';
import AboutPage from './components/AboutPage.vue';
import ContactPage from './components/ContactPage.vue';
import PetList from './components/PetList.vue';
import PitanieList from './components/PitanieList.vue';
import LoginPage from './components/LoginPage.vue';
import RegisterPage from './components/RegisterPage.vue';
import ViewPet from './components/ViewPet.vue';
import ViewPitanie from './components/ViewPitanie.vue';

const routes = [
  { path: '/', component: HomePage },          // Исправлено с Home на HomePage
  { path: '/about', component: AboutPage },    // Исправлено с About на AboutPage
  { path: '/contact', component: ContactPage },// Исправлено с Contact на ContactPage
  { path: '/pets', component: PetList },
  { path: '/pitanie', component: PitanieList },
  { path: '/login', component: LoginPage },    // Исправлено с Login на LoginPage
  { path: '/register', component: RegisterPage }, // Исправлено с Register на RegisterPage
  { path: '/view-pet/:id', component: ViewPet },
  { path: '/view-pitanie/:id', component: ViewPitanie },
];

const router = createRouter({
  history: createWebHistory(),
  routes,
});

export default router;
